import styled from "styled-components";

export const Footer = styled.footer`
  background: #333b3e;
  color: white;
  position: fixed;
  bottom: 0;
  width: 100%;
  display: flex;
  align-items: center;
  padding: 0 10px;
  height: 10vh;

  export const Titulo = styled.h4
`
